        title: String!
        description: String!
        price: Float!
        date: String!
    }

    type Query {
        events : [Event!]!
    }

    type Mutation {
        createEvent(eventInput: EventInput) : Event
    }
`;


export default makeExecutableSchema({
    typeDefs,
    resolvers
});

