import mongoose,{Schema} from 'mongoose'

const eventSchema = new Schema({
    title: {
        type: String,
        required: true
      },
      description: {
        type: String,
        required: true
      },
      price: {
        type: Number,
        required: true
      },
      date: {
        type: String,
        required: true
      }
})

export const Event = mongoose.model("Event", eventSchema)
